contract.title:
Выполнение работ по текущему ремонту автомобильных дорог общего пользования федерального значения: 
ремонт автомобильной дороги А-121 "Сортавала" Санкт-Петербург - Сортавала - автомобильная дорога Р-21 "Кола" на участке км 61+740 - 76+740, Ленинградская область, протяжённостью 15,019 км (устройство тонкослойных покрытий); 
ремонт автомобильной дороги Р-23 Санкт-Петербург - Псков - Пустошка - Невель - граница с Республикой Белоруссия на участках подъездов к г. Луга № 1 и № 2, Ленинградская область, протяжённостью 13,000 км (устройство тонкослойных покрытий)
